import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { library } from '@fortawesome/fontawesome-svg-core'
import { fab } from '@fortawesome/free-brands-svg-icons'
import {  faGithub, faLinkedin } from '@fortawesome/free-brands-svg-icons'
// import { fas } from '@fortawesome/free-solid-svg-icons'
import { userCircle } from '@fortawesome/free-solid-svg-icons'

library.add(fab, faGithub, faLinkedin)

class Footer extends React.Component {
    constructor (props) {
        super(props);
    }

  render() {
    return (
     <div className="footer">
      <a href="https://linkedin.com">
        <FontAwesomeIcon icon={['fab', 'linkedin']} />
      </a>
      <a href="https://github.com" className="footerLinks">
        <FontAwesomeIcon icon={['fab', 'github']} />      </a>
      <a href="https://jweaver.dev" className="footerLinks">
        <FontAwesomeIcon icon={['fas','userCircle']} />     
      </a>

    </div>
    );
  }
}

export default Footer;
